import React from 'react';

const Formulario = () => {
    return (  
        
            <div className="input-field col s12">
                <input id="ciudad" name="ciudad" type="text"/>
                <label htmlFor="ciudad">Ciudad:</label>
            </div>
           
    );
}

export default Formulario;
